import React from "react";
import ReactDOM from "react-dom/client";
import './index.css';

class Squares extends React.Component{
    render ()
    {
        return(
            <button className="square-button">{this.props.value}</button>
        )
    }
}
class Board extends React.Component{
    renderSquare(i)
    {
        return <Squares value={i} />;
    }
    render()
    {
        const playername = "Player : X";
        return(
            <div>
            <div className="playerdef">{playername}</div>
            <div className="board-row">
                {this.renderSquare(0)}
                {this.renderSquare(1)}
                {this.renderSquare(2)}
            </div>
            <div className="board-row">
                {this.renderSquare(3)}
                {this.renderSquare(4)}
                {this.renderSquare(5)}
            </div>
            <div className="board-row">
                {this.renderSquare(6)}
                {this.renderSquare(7)}
                {this.renderSquare(8)}
            </div>
            </div>
        )
    }
}
class Game extends React.Component
{
    render()
    {
        return(
            <div>
                <div className="game-board">
                    <Board/>
                </div>
                <div className="game-info">
                    <div className="game-sts">

                    </div>
                    <p className="game-todo">

                    </p>
                </div>
            </div>

        )
    }
}
const root  = ReactDOM.createRoot(document.getElementById('root'));
root.render(<Game />)
